goofy_string = ""


def happy_new_year():
    """
    Prints a numeric message representing "2023".

    This function calculates and prints a numeric message "2023" using the ASCII
    values of specific characters ('c', 'a', 'c', 'd').

    Returns:
        None: This function does not return a value. It prints the numeric message.
    """
    res = ""
    res += str(ord('c') - ord('a'))  # 2
    res += str(ord('a') - ord('a'))  # 0
    res += str(ord('c') - ord('a'))  # 2
    res += str(ord('d') - ord('a'))  # 3
    print(res)


def main():
    happy_new_year()

    print(len(goofy_string))


if __name__ == "__main__":
    main()
